function About() {
    return (
      <div className="max-w-2xl mx-auto mt-10 p-4">
        <h1 className="text-2xl font-bold mb-4">About This ChatBot</h1>
        <p>
          This is a smart customer query assistant built using React, Node.js, MySQL, and AI.
          It can respond to FAQs, handle product inquiries, and simulate real-time chat with typing indicators.
        </p>
      </div>
    );
  }
  
  export default About;
